import React, { Component } from 'react'
import './content.css'

export default class Column extends React.Component{
    render(){
        return (
            <div className='canvasSection'>
            <div className='drawingCanvas'>
              <h1>{this.props.column.title}</h1>
            </div>  
           </div> 
        )


    }
}
